import React from "react";

import Link from "next/link";
import { FaGithub } from "react-icons/fa";

const Header = props => {
  return (
    <header
      style={{
        fontSize: "3vw",
        display: "flex",
        justifyContent: "space-evenly",
        alignItems: "center",
        background: "rgb(126,241,142)",
        background:
          "linear-gradient(90deg, rgba(126,241,142,1) 0%, rgba(0,255,246,1) 100%)",
        height: "10vh",
        width: "100vw",
      }}
    >
      <Link href='/'>
        <h3 style={{ cursor: "pointer" }}>World</h3>
      </Link>
      <Link href='/countries'>
        <h3 style={{ cursor: "pointer" }}>Countries</h3>
      </Link>
      <Link href='/states'>
        <h3 style={{ cursor: "pointer" }}>States</h3>
      </Link>
      <a
        href='https://www.github.com/cnr-mtsn/rona'
        style={{
          display: "flex",
          justifyContent: "flex-start",
          marginLeft: "20px",
          color: "black",
          alignItems: "center",
        }}
      >
        <FaGithub size={18} />
      </a>
    </header>
  );
};

export default Header;
